import React from 'react'
import {Link} from 'react-router-dom'
import styles from './Navigation.module.css'

const Navigation = () => {
  const logoStyle = {
    color:'#FFF',
  }
  return (
    <nav className={`${styles.navbar} container`}>
      <Link to="/">
        <img src="/images/logo.png" alt="logo"/>
        <span>MERNstack</span>
      </Link>
    </nav>
  );
}

export default Navigation;
